void init()
{
    if (element.args().caller())
    {
        sysWizard = element.args().caller();
    }

    super();

    tmpDefaultDataSetup.setTmpData(sysWizard.tmpDefaultDataSetup());

    wmsParameters = WMSParameters::find();

    sysWizard.WMSLocationWizardTableCtrl_Aisle().parmForm_DS(wmsAisle_ds);
    sysWizard.WMSLocationWizardTableCtrl_Aisle().init();
    sysWizard.setBufferAisle(wmsAisle);

    sysWizard.WMSLocationWizardTableCtrl_InboundDock().parmForm_DS(inboundDock_ds);
    sysWizard.WMSLocationWizardTableCtrl_InboundDock().init();

    sysWizard.WMSLocationWizardTableCtrl_OutboundDock().parmForm_DS(outboundDock_ds);
    sysWizard.WMSLocationWizardTableCtrl_OutboundDock().init();

    sysWizard.WMSLocationWizardTableCtrl_Pick().parmForm_DS(pickingLocation_ds);
    sysWizard.WMSLocationWizardTableCtrl_Pick().init();

    sysWizard.WMSLocationWizardTableCtrl_Buffer().parmForm_DS(bufferLocation_ds);
    sysWizard.WMSLocationWizardTableCtrl_Buffer().init();

    noSelected = NoYes::No;

    /* setup last page */
    listview.addColumn(1,new FormListColumn("@SYS7576",1,130));
    listview.addColumn(2,new FormListColumn("@SYS55971",2,65));
    listview.addColumn(3,new FormListColumn("@SYS55972",2,75));
}

void initTabPage(int fromPage, int toPage)
{
    switch (fromPage)
    {
        case #SETUPPAGE                 :
            if (toPage > fromPage)
            {
                element.leaveSetupPage();
            }
            break;
        case #AISLEPAGE                 :
            if (toPage == #AISLEPAGE2 && sysWizard.WMSLocationWizardTableCtrl_Aisle().parmUpdate())
            {
                sysWizard.WMSLocationWizardTableCtrl_Aisle().createTable();
            }
            break;
        case #INBOUNDDOCKPAGE           :
            if (toPage == #INBOUNDDOCKPAGE2 && sysWizard.WMSLocationWizardTableCtrl_InboundDock().parmUpdate())
            {
                sysWizard.WMSLocationWizardTableCtrl_InboundDock().createTable();
            }
            break;
        case #OUTBOUNDDOCKPAGE          :
            if (toPage == #OUTBOUNDDOCKPAGE2 && sysWizard.WMSLocationWizardTableCtrl_OutboundDock().parmUpdate())
            {
                sysWizard.WMSLocationWizardTableCtrl_OutboundDock().createTable();
            }
            break;
        case #PICKPAGE:
            element.getPickingShelfFromTable();
            element.getPickingBinFromTable();
            break;
        case #PICKPAGE2                 :
            if (toPage == #PICKPAGE3 && sysWizard.WMSLocationWizardTableCtrl_Pick().parmUpdate())
            {
                sysWizard.WMSLocationWizardTableCtrl_Pick().createTable();
            }
            break;
        case #BUFFERPAGE:
            element.getBufferShelfFromTable();
            element.getBufferBinFromTable();
            break;
        case #BUFFERPAGE2               :
            if (toPage == #BUFFERPAGE3 && sysWizard.WMSLocationWizardTableCtrl_Buffer().parmUpdate())
            {
                sysWizard.WMSLocationWizardTableCtrl_Buffer().createTable();
            }
            break;
    }

    switch (toPage)
    {
        case #SETUPPAGE                 :
            element.setSkipTab();
            break;
        case #LASTPAGE                  :
            sysWizard.summaryBuild(listView,endTxtStr);
            EndTxt.text(EndTxtStr.text());
            break;
        case #PICKPAGE:
            element.setupPickingShelfTable();
            element.setupPickingBinTable();
            break;
        case #BUFFERPAGE:
            element.setupBufferShelfTable();
            element.setupBufferBinTable();
            break;
    }
}

