}

void leaveSetupPage()
{
    if (!sysWizard.WMSLocationWizardTableCtrl_Aisle().parmUpdate())
    {
        sysWizard.WMSLocationWizardTableCtrl_Aisle().deleteTable(true);
    }

    if (!sysWizard.WMSLocationWizardTableCtrl_InboundDock().parmUpdate())
    {
        sysWizard.WMSLocationWizardTableCtrl_InboundDock().deleteTable(true);
    }

    if (!sysWizard.WMSLocationWizardTableCtrl_OutboundDock().parmUpdate())
    {
        sysWizard.WMSLocationWizardTableCtrl_OutboundDock().deleteTable(true);
    }

    if (!sysWizard.WMSLocationWizardTableCtrl_Pick().parmUpdate())
    {
        sysWizard.WMSLocationWizardTableCtrl_Pick().deleteTable(true);
    }

    if (!sysWizard.WMSLocationWizardTableCtrl_Buffer().parmUpdate())
    {
        sysWizard.WMSLocationWizardTableCtrl_Buffer().deleteTable(true);
    }
}

