void setSkipTab(boolean _setEnableNext = true)
{
    NoYes       allDisabled = NoYes::Yes;
    boolean     enable1, enable2;

    if (!sysWizard)
    {
        return;
    }

    enable1 = sysWizard.WMSLocationWizardTableCtrl_Aisle().enableParmTab();
    enable2 = sysWizard.WMSLocationWizardTableCtrl_Aisle().enableGridTab();
    sysWizard.skipTab(#AISLEPAGE,          !enable1);
    sysWizard.skipTab(#AISLEPAGE2,         !enable2);
    allDisabled = (enable1) ? NoYes::No : allDisabled;

    enable1 = sysWizard.WMSLocationWizardTableCtrl_InboundDock().enableParmTab();
    enable2 = sysWizard.WMSLocationWizardTableCtrl_InboundDock().enableGridTab();
    sysWizard.skipTab(#INBOUNDDOCKPAGE,    !enable1);
    sysWizard.skipTab(#INBOUNDDOCKPAGE2,   !enable2);
    allDisabled = (enable1) ? NoYes::No : allDisabled;

    enable1 = sysWizard.WMSLocationWizardTableCtrl_OutboundDock().enableParmTab();
    enable2 = sysWizard.WMSLocationWizardTableCtrl_OutboundDock().enableGridTab();
    sysWizard.skipTab(#OUTBOUNDDOCKPAGE,   !enable1);
    sysWizard.skipTab(#OUTBOUNDDOCKPAGE2,  !enable2);
    allDisabled = (enable1) ? NoYes::No : allDisabled;

    enable1 = sysWizard.WMSLocationWizardTableCtrl_Pick().enableParmTab();
    enable2 = sysWizard.WMSLocationWizardTableCtrl_Pick().enableGridTab();
    sysWizard.skipTab(#PICKPAGE,           !enable1);
    sysWizard.skipTab(#PICKPAGE2,          !enable2);
    sysWizard.skipTab(#PICKPAGE3,          !enable2);
    allDisabled = (enable1) ? NoYes::No : allDisabled;

    enable1 = sysWizard.WMSLocationWizardTableCtrl_Buffer().enableParmTab();
    enable2 = sysWizard.WMSLocationWizardTableCtrl_Buffer().enableGridTab();
    sysWizard.skipTab(#BUFFERPAGE,         !enable1);
    sysWizard.skipTab(#BUFFERPAGE2,        !enable2);
    sysWizard.skipTab(#BUFFERPAGE3,        !enable2);
    allDisabled = (enable1) ? NoYes::No : allDisabled;

    if (!sysWizard.parmInventLocationId())
        allDisabled = NoYes::Yes;

    switch (sysWizard.curTab())
    {
        case #SETUPPAGE             :
            if (_setEnableNext)
            {
                if (noSelected != allDisabled)
                {
                    sysWizard.nextEnabled(!allDisabled);
                    noSelected = allDisabled;
                }
            }
            break;
    }
    return;
}

void setTexts()
{
    InventLocation  inventLocation = InventLocation::find(sysWizard.parmInventLocationId());

    selectionTxt.text("@SYS65377"+' '+"@SYS57665");

    aisleTxt_1.text("@SYS57509");
    aisleTxt_2.text("@SYS57516"+' '+"@SYS57517");

    aisleTxt_3.text("@SYS57515");
    aisleTxt_4.text("@SYS57514");
    aisleTxt_5.text("@SYS55894");

    inboundDockTxt_1.text("@SYS57487");
    inboundDockTxt_3.text("@SYS57505");
    inboundDockTxt_4.text("@SYS121993");

    outboundDockTxt_1.text("@SYS57497");
    outboundDockTxt_3.text("@SYS57508");
    outboundDockTxt_4.text("@SYS121994");

    if (inventLocation && !inventLocation.wmsAisleNameActive)
    {
        pickingLocationAisle.visible(false);
        bufferLocationAisle.visible(false);
    }
    else
    {
        pickTxt_3.text("@SYS57531");
        bufferTxt_3.text("@SYS57754");
    }

    if (inventLocation && !inventLocation.wmsRackNameActive)
    {
        pickingLocationRack.visible(false);
        bufferLocationRack.visible(false);
    }
    else
    {
        pickTxt_4.text("@SYS57537");
        bufferTxt_4.text("@SYS57573");
    }

    if (inventLocation && !inventLocation.wmsLevelNameActive)
    {
        pickingLocationShelf.visible(false);
        bufferLocationShelf.visible(false);
    }
    else
    {
        pickTxt_5.text("@SYS57541");
        bufferTxt_5.text("@SYS57576");
    }

    if (inventLocation && !inventLocation.wmsPositionNameActive)
    {
        pickingLocationBin.visible(false);
        bufferLocationBin.visible(false);
    }
    else
    {
        pickTxt_6.text("@SYS57543");
        bufferTxt_6.text("@SYS57577");
    }

    pickTxt_1.text("@SYS57526");
    pickTxt_2.text("@SYS57547" + ' ' + "@SYS57548" + ' ' + "@SYS57550");

    pick2Txt_1.text("@SYS57553" + '\n\n' + "@SYS57554");
    pick2Txt_4.text("@SYS57558");

    bufferTxt_1.text("@SYS57567");
    bufferTxt_2.text("@SYS57569" + ' ' + "@SYS57570" + ' ' + "@SYS57571");

    buffer2Txt_1.text("@SYS57579" + '\n\n' + "@SYS57580");
    buffer2Txt_4.text("@SYS57558");
}

