edit NoYes update(
    boolean             _set,
    TmpDefaultDataSetup _curTmpDefaultDataSetup,
    NoYes               _value)
{
    SysDefaultData defaultData;

    defaultData = sysWizard.tmpDefaultDataSetup2DefaultData(_curTmpDefaultDataSetup);
    if (_set)
    {
        defaultData.parmUpdate(_value);
        element.setSkipTab();
    }
    return defaultData.parmUpdate();
}

